server:  port: 10086eureka:  instance:    prefer-ip-address: true  client:    register-with-eureka: true    fetch-registry: true    region: beijing    availability-zones:      beijing: haidian        service-url:        haidian: http://localhost:9999/eureka/                zuul:  prefix: /api  routes:      licensingservice : /licensing/**     organizationservice: /org/**          licensestatic:        path: /licensestatic/**        url: http://localhost:8080                           hystrix:  command:    default:      execution:        isolation:          thread:            timeoutInMilliseconds: 7000 licensingservice:  ribbon:    ReadTimeout: 7000          #Setting logging levelslogging:    level:      com.netflix: WARN      org.springframework.web: WARN      com.thought: debug                            spring:  jackson:    serialization:      indent-output: true         